import React, { useCallback, useState } from "react";
import {
  LogicticsBacground,
  ContinueButton,
  ContinueView,
  LogisticsCountryText,
  LogisticsCountryContainer,
  LogisticsHeaderIconContainer,
  ContinuewButtonText,
} from "../components/logictics.styles";
import { getNames } from "country-list";
import { Spacer } from "../../../components/spacer/spacer.component";
import {
  View,
  Image,
  Pressable,
  StyleSheet,
  TouchableWithoutFeedback,
} from "react-native";
import Selector from "../../../components/Selector";
import LogisticsInfo from "../components/LogisticsInfo";
import LogisticsButtonTabGroup from "../components/LogisticsButtonTabGroup";
import DateTimePicker from "@react-native-community/datetimepicker";
import useDateTimePicker from "../../../hooks/useDateTimePicker";
import { useNavigation } from "@react-navigation/native";
import Header from "../../../components/Header";
import { Layout, Text } from "../../../components/Layout";
import style from "../components/AddressBox/style";
import OneOff from "../components/OneOff";
import Multiple from "../components/Multiple";
import { StyledMultiButton } from "../components/Multiple/styles";

export default function Logisticscreen() {
  const navigation = useNavigation();
  const [isMultiple, setIsMultiple] = useState(false);

  return (
    <Layout
      styles={{
        paddingHorizontal: 50,
      }}
    >
      <Header
        iconLeft={require("../../../../assets/delivery.png")}
        iconRight={require("../../../../assets/history.png")}
        onRightIconPress={() => navigation.navigate("orderHistory")}
        containerStyle={{
          paddingHorizontal: 20,
        }}
      />

      <View
        style={[
          styles.row,
          {
            justifyContent: "space-around",
            paddingHorizontal: 50,
            marginBottom: 20,
          },
        ]}
      >
        <Pressable style={{}} onPress={() => setIsMultiple(false)}>
          <Text
            style={[
              styles.screenToggleBtn,
              { color: isMultiple ? "#4E4E4E" : "#fff" },
            ]}
          >
            One Off
          </Text>
        </Pressable>
        <View style={{ borderColor: "#fff", borderWidth: 1 }} />
        <Pressable onPress={() => setIsMultiple(true)}>
          <Text
            style={[
              styles.screenToggleBtn,
              { color: !isMultiple ? "#4E4E4E" : "#fff" },
            ]}
          >
            Multiple
          </Text>
        </Pressable>
      </View>

      {/* Container */}
      <View style={[styles.container]}>
        {!isMultiple ? <OneOff /> : <StyledMultiButton />}

        <Spacer size="xxl">
          <ContinueView>
            <ContinueButton onPress={() => navigation.navigate("Yoris Pay")}>
              <ContinuewButtonText>continue</ContinuewButtonText>
            </ContinueButton>
          </ContinueView>
        </Spacer>
      </View>
    </Layout>
  );
}

const styles = StyleSheet.create({
  container: {
    paddingHorizontal: 20,
  },

  row: {
    flexDirection: "row",
  },
  iconContainer: {
    alignItems: "flex-end",
  },

  icon: {
    marginRight: 10,
    width: 30,
    height: 30,
  },
  iconText: {
    color: "#fff",
    fontSize: 17,
    fontWeight: "bold",
  },
  screenToggleBtn: {
    fontSize: 16,
    fontWeight: "300",
  },
});
